import { findByLabelText } from "@testing-library/react";
import React from "react";
const Profile = (props) => {
    const alignement = { display: flex, justifyContent: spaceBetween }
    const name = { color: '#093219', }
    const bold = { fontWeight: bold, }
    return (
        <>
            <div style={alignement}>
                <div>
                    <img src={props.children} alt="photo" />
                    <h5 style={name}>props.name</h5>
                    <span style={bold}>Bio:</span> <p>props.bio</p>
                    <span style={bold}>Formation:</span><p>props.profession</p>

                </div>
            </div>

        </>
    );
};
export default Profile;
